import React from 'react';

class Signin extends React.Component {




render(){
return  (
  <center>
  <div className="container">
    <div className="z-depth-1 orange lighten-3 cardAccount" >
    <h1 className="girlNextDoor">Sign in</h1>
    <div className="card horizontal">

    <div className="card-content">
      <div className="input-field">
        <input id="email" type="text" className="validate " />
        <label htmlFor="email">Username</label>
      </div>

      <div className="input-field">
        <input id="email" type="password" className="validate" />
        <label htmlFor="email">Password</label>
      </div>

      <button className="btn deep-orange darken-4 z-depth-5 waves-effect waves-light" type="submit" name="action">sign in</button>
      <br/><p onClick={() => this.onRouteChange('register')} className='pointer'>Don't have an account? Register here</p>
      </div>
         </div>



      </div>
          </div>

  </center> 
      );
}}

export default Signin;
